import React from 'react';
import { Link, Route } from "react-router-dom";



const App = () => {
  const Home = () => <h2>Home</h2>;
  const About = () => <h2>App</h2>;
  return (
    <div>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <Route exact path="/" component={Home} />
      <Route path="/about" component={About} />
    </div>
  );
};


export default App;
